css:
.editor-colors {
  background-color: #111111;
  color: #00ff00;
}
.editor .invisible-character {
  color: rgba(0, 255, 0, 0.8);
}
.editor .indent-guide {
  color: rgba(0, 255, 0, 0.85);
}
.editor .wrap-guide {
  background-color: rgba(0, 255, 0, 0.9);
}
.editor .gutter {
  background-color: #191919;
}
.editor .gutter .cursor-line {
  background-color: #009900;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #009900;
}
.editor .invisible {
  color: #00ff00;
}
.editor .cursor {
  border-color: #00ff00;
}
.editor .selection .region {
  background-color: #009900;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #003300;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #00ff00;
}
.editor .comment {
  color: #555753;
}
.editor .string {
  color: #fce94f;
}
.editor .constant.numeric {
  color: #75507b;
}
.editor .constant.language {
  color: #75507b;
}
.editor .constant.character,
.editor .constant.other {
  color: #75507b;
}
.editor .keyword {
  color: #cc0000;
}
.editor .storage {
  color: #cc0000;
}
.editor .storage.type {
  font-style: italic;
  color: #21fcff;
}
.editor .entity.name.class {
  text-decoration: underline;
  color: #eeeeec;
}
.editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #eeeeec;
}
.editor .entity.name.function {
  color: #eeeeec;
}
.editor .entity.name.instance {
  color: #21fcff;
}
.editor .variable.parameter {
  font-style: italic;
  color: #f57900;
}
.editor .entity.name.tag {
  color: #cc0000;
}
.editor .entity.other.attribute-name {
  color: #eeeeec;
}
.editor .support.function {
  color: #21fcff;
}
.editor .support.constant {
  color: #21fcff;
}
.editor .support.type,
.editor .support.class {
  font-style: italic;
  color: #21fcff;
}
.editor .invalid {
  color: #eeeeec;
  background-color: #cc0000;
}
.editor .invalid.deprecated {
  color: #eeeeec;
  background-color: #75507b;
}
.editor .class.jade {
  color: #75507b;
}
.editor .gfm .markup.heading {
  color: #eeeeec;
  font-weight: bold;
}
.editor .gfm .markup.underline {
  color: #fce94f;
  text-decoration: underline;
}
.editor .gfm .bold {
  font-weight: bold;
}
.editor .gfm .italic {
  font-style: italic;
}
.editor .gfm .raw {
  color: #21fcff;
}
.editor .gfm .variable.list {
  color: #cc0000;
  font-weight: bold;
}
.editor .gfm .link {
  color: #4e9a06;
}
.editor .gfm .link .entity {
  color: #75507b;
}
.editor .meta.brace.curly,
.editor .meta.brace.square {
  color: #3465a4;
}
